function contactsMap() {
    const contactsIntro = document.querySelector('[data-js="contactsIntro"]')

    if(!contactsIntro) return

    const mapEl = contactsIntro.querySelector('[data-js="contactsIntroMap"]')
    const pointsList = [... contactsIntro.querySelectorAll('[data-js="contactsIntroItem"]')].map(item => item.dataset.coords)
    const startCenter = mapEl.dataset.center ? mapEl.dataset.center : '55.883459, 37.444566'
    const startZoom = mapEl.dataset.zoom ? parseInt(mapEl.dataset.center) : 12

    ymaps.ready(async function () {
        // строим карту
        let center = startCenter
        let zoom = startZoom
    
        mapEx = new ymaps.Map(mapEl, {
            center: center.replace(/\s/g, '').split(","),
            zoom: zoom,
            controls: []
        }, {
            minZoom: 3,
        });

        renderPoints(pointsList)

        // отрисовывает точки на карте
        function renderPoints(items) {
            mapEx.geoObjects.removeAll()
    
            let myGeoObjects = [];
                
            items.forEach((coordsItem, index) => {
                let iconHref = `data:image/svg+xml,%3Csvg width='60' height='68' viewBox='0 0 60 68' fill='none' xmlns='http://www.w3.org/2000/svg' xmlns:xlink='http://www.w3.org/1999/xlink'%3E%3Crect width='60' height='68' fill='url(%23pattern0_514_5911)'/%3E%3Cdefs%3E%3Cpattern id='pattern0_514_5911' patternContentUnits='objectBoundingBox' width='1' height='1'%3E%3Cuse xlink:href='%23image0_514_5911' transform='scale(0.00833333 0.00735294)'/%3E%3C/pattern%3E%3Cimage id='image0_514_5911' width='120' height='136' preserveAspectRatio='none' xlink:href='data:image/png;base64,'/%3E%3C/defs%3E%3C/svg%3E`
    
                let currentPlacemark = new ymaps.Placemark(
                    coordsItem.replace(/[\[\]]/g, '').split(","),
                    {},
                    {
                        hasBalloon: false,
                        hasHint: false,
                        iconLayout: 'default#image',
                        iconImageHref: iconHref,
                        iconImageSize: [60, 68],
                        iconImageOffset: [-30, -68],
                    }
                );
    
                
                myGeoObjects.push(currentPlacemark)
            });
    
            var clusterer = new ymaps.Clusterer({
                gridSize: 50,
                preset: 'islands#darkBlueCircleIcon'
            });
    
            clusterer.add(myGeoObjects);
    
            mapEx.geoObjects.add(clusterer);

            if (myGeoObjects.length > 0) {
                mapEx.setBounds(clusterer.getBounds(), {
                    checkZoomRange: true,
                    zoomMargin: 50
                });
            }
    
        }
    })

}